import React, { useState } from 'react';
import './Profile.css';

function Profile() {
  const [activeSection, setActiveSection] = useState('info');
  const [avatar, setAvatar] = useState(null); // To store the uploaded avatar

  // Function to handle avatar change
  const handleAvatarChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const avatarURL = URL.createObjectURL(file);
      setAvatar(avatarURL); // Update the avatar state with the new image URL
    }
  };

  // Function to render content based on the active section
  const renderContent = () => {
    switch (activeSection) {
      case 'changeEmail':
        return (
          <div>
            <h2>Change Email</h2>
            <form>
              <label>Old Email:</label>
              <input type="email" placeholder="Old Email" />
              <br />
              <label>New Email:</label>
              <input type="email" placeholder="New Email" />
            </form>
          </div>
        );
      case 'changePassword':
        return (
          <div>
            <h2>Change Password</h2>
            <form>
              <label>Old Password:</label>
              <input type="password" placeholder="Old Password" />
              <br />
              <label>New Password:</label>
              <input type="password" placeholder="New Password" />
            </form>
          </div>
        );
      case 'addFriend':
        return <h2>Add Friend</h2>;
      case 'friendList':
        return <h2>Friend List</h2>;
      case 'matchHistory':
        return <h2>Match History</h2>;
      case 'info':
      default:
        return (
          <div className="user-info">
            <h2>User Info</h2>
            <p>Username: diaraz</p>
            <p>Email: diaraz@example.com</p>
          </div>
        );
    }
  };

  return (
    <div className="user-container">
      <div className="sidebar">
        <ul>
          <li onClick={() => setActiveSection('changeEmail')}>Change Email</li>
          <li onClick={() => setActiveSection('changePassword')}>Change Password</li>
          <li onClick={() => setActiveSection('addFriend')}>Add Friend</li>
          <li onClick={() => setActiveSection('friendList')}>Friend List</li>
          <li onClick={() => setActiveSection('matchHistory')}>Match History</li>
        </ul>
      </div>


      <div className="avatar-container">
        <img 
          src={avatar || 'https://via.placeholder.com/150'} 
          alt="Avatar" 
          className="avatar"
        />
        <input 
          type="file" 
          accept="image/*" 
          onChange={handleAvatarChange} 
          className="avatar-upload" 
        />
        <p className="change-avatar-text">Change Avatar</p>
      </div>


      <div className="user-info">
        {renderContent()}
      </div>
    </div>
  );
}

export default Profile;
